import React from 'react'

export const TreeCrawl = ({items}) => {
    return (
        <ul>
            {Object.keys(items).map((key, index)=>{
                var item = items[key]
                return (
                <li key={key}>
                    <span>{item.title}</span>
                    {item.children &&
                    <TreeCrawl items={item.children} />
                    }                    
                </li>)             
            })}
        </ul>
    )
}
